import React from 'react';
import './DailyScorePopup.scss';

const DailyScorePopup = ({ dailyData }) => {
  // Check if dailyData and aggregated_data are properly defined
  if (!dailyData || !dailyData.aggregated_data) {
    return <p>No daily data available.</p>;
  }

  // Use optional chaining (?.) to safely access nested properties and fallback values
  const speedKmh = dailyData.aggregated_data['Speed(km/h)'] ?? 'N/A';
  const acceleration = dailyData.aggregated_data['Acceleration(m/s^2)'] ?? 'N/A';
  const jerk = dailyData.aggregated_data['Jerk(m/s^3)'] ?? 'N/A';
  const brakingIntensity = dailyData.aggregated_data['Braking_Intensity'] ?? 'N/A';
  const sasv = dailyData.aggregated_data['SASV'] ?? 'N/A';
  const speedViolation = dailyData.aggregated_data['Speed_Violation'] ?? 'N/A';
  const headingChange = dailyData.aggregated_data['Heading_Change(degrees)'] ?? 'N/A';

  // Handle NaN values
  const formattedJerk = isNaN(jerk) ? 'N/A' : jerk;

  return (
    <div className="daily-score-popup">
      <h3>Daily Driving Summary</h3>
      <div className="summary-container">
        <div className="summary-item">
          <h4>Driving Score</h4>
          <p>{dailyData.driving_score || 'N/A'} / 100</p>
        </div>
        <div className="summary-item">
          <h4>Driving Category</h4>
          <p>{dailyData.driving_category || 'N/A'}</p>
        </div>
        <div className="summary-item">
          <h4>Total Distance Covered</h4>
          <p>{dailyData.total_distance_covered_km || 'N/A'} km</p>
        </div>
        <div className="summary-item">
          <h4>Average Speed</h4>
          <p>{speedKmh} km/h</p>
        </div>
        <div className="summary-item">
          <h4>Acceleration</h4>
          <p>{acceleration} m/s²</p>
        </div>
        <div className="summary-item">
          <h4>Jerk</h4>
          <p>{formattedJerk} m/s³</p>
        </div>
        <div className="summary-item">
          <h4>Braking Intensity</h4>
          <p>{brakingIntensity}</p>
        </div>
        <div className="summary-item">
          <h4>Heading Change</h4>
          <p>{headingChange} degrees</p>
        </div>
        <div className="summary-item">
          <h4>Speed Violations</h4>
          <p>{speedViolation}</p>
        </div>
        <div className="summary-item">
          <h4>SASV (Sudden Acceleration/Speed Violation)</h4>
          <p>{sasv}</p>
        </div>
      </div>
    </div>
  );
};

export default DailyScorePopup;
